import React from "react";

const App = () => {
    let date = new Date(); 
    let hh = date.getHours();
    let mm = date.getMinutes(); 
    let ss = date.getSeconds()
    return (
        <>
            {hh}:{mm}:{ss}
            <button>get time!</button>
        </>
    )
}
export default App
